First Week Retention with MongoDB<p>One table with session start events:</p>

<p><a href="https://i.stack.imgur.com/u9eEr.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/u9eEr.png" alt="start data sheet"></a></p>

<p>Registered - unixtime - when the user was registered (first time opened the app)</p>

<p>DateTime - unixtime - time when the event was sent (when player installs the app and opens it for the first time: Registered = DateTime)</p>

<p><code>PlayerId</code> - unique ID for player (same ID - always same Registered, but same registered - may be more than one <code>PlayerId</code> for it)</p>

<p>I need to get the table like this:</p>

<p><a href="https://i.stack.imgur.com/EMuKq.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/EMuKq.png" alt="Nice-looking Retention sheet"></a></p>

<p>Made this query (MongoDB for redash) so far:</p>

<pre><code>{
    "collection": "dance",
    "aggregate": [
        {
            "$match": {
                "$and": [
                    {
//---filter for the range of Day0 dates
//---need to build Ret_Day1 - Ret_Day7 for each
                        "Registered": {
                            "$lt": "ISODate(\"{{Finish date}}\")"
                        }
                    },
                    {
                        "Registered": {
                            "$gt": "ISODate(\"{{Start date}}\")"
                        }
                    },
                    {
                        "EventType": "Session Start"
                    }
                ]
            }
        },
        {
            "$group": {
                "_id": {
                    "DayZero": {
                        "$dateToString": {
                            "format": "%Y-%m-%d",
                            "date": "$Registered"
                        }
                    },
                    "DayActive": {
                        "$dateToString": {
                            "format": "%Y-%m-%d",
                            "date": "$DateTime"
                        }
                    },
                    "PlayerId": "$PlayerId"
                }
            }
        },
        {
            "$group": {
                "_id": {
                    "DayZero": "$_id.DayZero",
                    "DayActive": "$_id.DayActive"
                },
                "Ret": {
                    "$sum": 1
                }
            }
        },
        {
            "$project": {
                "_id": "1",
                "DayZero": {
                    "$dateFromString": {
                        "dateString": "$_id.DayZero"
                    }
                },
                "DayActive": {
                    "$dateFromString": {
                        "dateString": "$_id.DayActive"
                    }
                },
                "Ret": 1
            }
        },
        {
            "$project": {
                "Days": {
                    "$divide": [
                        {
                            "$subtract": [
                                "$DayActive",
                                "$DayZero"
                            ]
                        },
                        86400000
                    ]
                },
                "DayZero": {
                    "$dateToParts": {
                        "date": "$DayZero",
                        "timezone": "+02:00"
                    }
                },
                "Ret": 1
            }
        },
        {
            "$project": {
                "Ret": 1,
                "Days": 1,
                "DayZero": {
                    "$concat": [
                        {
                            "$toString": "$DayZero.day"
                        },
                        ".",
                        {
                            "$toString": "$DayZero.month"
                        },
                        ".",
                        {
                            "$toString": "$DayZero.year"
                        }
                    ]
                }
            }
        }
    ]
}
</code></pre>

<p>Result:</p>

<p><a href="https://i.stack.imgur.com/nU1c2.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/nU1c2.png" alt="raw data"></a></p>

<p>In redash I can build such visualization:</p>

<p><a href="https://i.stack.imgur.com/lj3sA.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/lj3sA.png" alt="pivot table"></a></p>

<p>But it's not good enough - so I want to fill the new fields (R_Day1 - R_Day7) with the number of users and percent of users. Which method will be the easiest for calculating the percents for each day?</p>

