How do I count all the documents in a collection and use the cont in a controller, with MongoDB and Express.js?<p>I am working on a <strong><a href="https://github.com/Ajax30/XPressBlog" rel="nofollow noreferrer">blogging application</a></strong> (click the link to see the <strong>GitHub</strong> repo) with Express (version 4.17.1), <a href="https://ejs.co/" rel="nofollow noreferrer">EJS</a> and MongoDB (version 4.0.10).</p>

<p>Trying to paginate the posts I did the following, in the controller:</p>

<pre><code>exports.getPosts = (req, res, next) =&gt; {

    const perPage = 5;

    const currPage = req.query.page ? parseInt(req.query.page) : 1;

    let postsCount = 0;

    const posts = Post.find({}, (err, posts) =&gt; {

            postsCount = posts.length;

            let pageDecrement = currPage &gt; 1 ? 1 : 0;

            let pageIncrement = postsCount &gt;= perPage ? 1 : 0;

            if (err) {
                console.log('Error: ', err);
            } else {
                res.render('default/index', {
                    moment: moment,
                    layout: 'default/layout',
                    website_name: 'MEAN Blog',
                    page_heading: 'XPress News',
                    page_subheading: 'A MEAN Stack Blogging Application',
                    currPage: currPage,
                    posts: posts,
                    pageDecrement: pageDecrement,
                    pageIncrement: pageIncrement
                });
            }
        })
        .sort({
            created_at: -1
        })
        .populate('category')
        .limit(perPage)
        .skip((currPage - 1) * perPage);
};
</code></pre>

<p>And in the view:</p>

<pre><code>&lt;a class="btn btn-primary &lt;%= pageDecrement == 0 ? 'disabled' : '' %&gt;" href="/?page=&lt;%= currPage - pageDecrement %&gt;"&gt;&amp;larr; Newer Posts&lt;/a&gt;
</code></pre>

<p>and </p>

<pre><code>&lt;a class="btn btn-primary &lt;%= pageIncrement == 0 ? 'disabled' : '' %&gt;" href="/?page=&lt;%= currPage + pageIncrement %&gt;"&gt;Older Posts &amp;rarr;&lt;/a&gt;
</code></pre>

<p>That works fine unless there are is a number of posts equal to <code>perPage x N</code>, where N is an integer, in which case the "Older Posts" button becomes disabled one page too late. </p>

<p>That is because <code>postsCount = posts.length</code> counts the posts <em>after</em> they are limited by <code>.skip((currPage - 1) * perPage)</code>.</p>

<p>So I need to count the posts from the model/collection and bring that count variable <em>in</em> the controller.</p>

<p>My model:</p>

<pre><code>const mongoose = require('mongoose');

const postSchema = new mongoose.Schema({
    title: {
        type: String,
        required: true
    },
    short_description: {
        type: String,
        required: true
    },
    full_text: {
        type: String,
        required: true
    },
    category: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Category'
    },
    post_image: {
        type: String,
        required: false
    },
    updated_at: {
        type: Date,
        default: Date.now()
    },
    created_at: {
        type: Date,
        default: Date.now()
    }
});

module.exports = mongoose.model('Post', postSchema);
</code></pre>

<p>How do I count all the documents in the posts collection and use that number in the posts controller?</p>

