Get inserted document directly in RethinkDB<p>I have been starting with RethinkDB. I have gone through the documentation. I have a simple use case of returning the inserted document when a POST call is made. This is something I have done so far.</p>

<pre><code>router.post('/user', jsonParser, async (req: Request, res: Response) =&gt; {
  const connection = await conn;

  const { name, email, employeeId } = req.body;
  // Email is primary key
  consumerTable.insert({
    name,
    email,
    employeeId,
  }).run(connection, (err: any, result: any) =&gt; {
    if (err) {
      throw err;
    } else {
      consumerTable.get(email).run(connection, (innerErr: any, userResult: any) =&gt; {
        if(innerErr) {
          throw innerErr;
        } else {
          res.send({
            data: {
              ...userResult
            },
            responseCode: 200,
          });
        }
      });
    }
  });
});
</code></pre>

<p>Is there any way to get the inserted object in the insert result itself. I read a lot of documentation, but didn't find anything useful. </p>

<p>Any help would be great. Cheers!</p>

