Avoid duplicates while syncing MongoDB and Elasticsearch with Logstash JDBC plugin<p>I'm trying to keep a MongoDB collection in sync with an Elasticsearch index using Logstash. </p>

<p>I'm using the Logstash JDBC plugin with the <a href="https://dbschema.com/jdbc-driver/MongoDb.html" rel="nofollow noreferrer">DBSchema</a> JDBC Driver Library for this.</p>

<p>This is the configuration file I'm using for logstash:-</p>

<pre><code>input {
  jdbc{
    jdbc_driver_class =&gt; "com.dbschema.MongoJdbcDriver"
    jdbc_driver_library =&gt; "/path/to/mongojdbc1.8.jar"
    jdbc_user =&gt; ""
    jdbc_password =&gt; ""
    jdbc_connection_string =&gt; "jdbc:mongodb://127.0.0.1:27017/db1"
    statement =&gt; "db.collection1.find({ }, { '_id': false })"
  }
}

output {
  elasticsearch {
    hosts =&gt; ["http://127.0.0.1:9200"]
    index =&gt; "testing"
    user =&gt; ""
    password =&gt; ""
  }
}
</code></pre>

<p>This works alright, but when I run logstash multiple times, the records are inserted multiple times into Elasticsearch. I do not want records to be re-written. Also, if I modify a document and run logstash again, it should change the same record in Elasticsearch without creating a new document. How do I go about achieving this?</p>

