Mongoose query is very slow (even with lean)<p>I'm using MongoDB and I handle any modification with Mongoose in Express.
I think the query should be much faster. Correct me if I'm wrong but while this data is big, It isn't that huge. Especially because I'm not filtering or anything during the query.</p>

<p>So the model I use:</p>

<pre class="lang-js prettyprint-override"><code>const DataSchema = mongoose.Schema({
  title: String,
  text: String,
  text_transform: Array,
  provider: String,
  url: {
    type: String,
    unique: true,
  },
  word_count: Array,
  HOW: Array,
  date: Date,
  click_count: Number,
}); 
</code></pre>

<p>A few general truths:<br>
<strong>text</strong> size can vary. Can be 150 characters but can also be, let  us say 7000 characters... maybe even more (but generally less than 7000).<br>
<strong>text_transform</strong> is an array whose elements are the words of the <em>text</em>.<br>
<strong>provider</strong> is a short string, the maximum I have currently is 12 characters long.<br>
<strong>word_count</strong> is an array that has key-value pairs(arrays) as elements, like so: </p>

<pre><code>[
   ["key", value], ["other_key", other_value], ...
]
</code></pre>

<p>values are numbers, and keys are strings.<br>
<strong>HOW</strong> is an array with a maximum of 5 elements, that are strings. ~6-10 characters.  </p>

<p>I have my own API and a request to some endpoint will generally trigger a a query.<br>
My issue comes with trying to retrieve all my data.</p>

<p>So I send a request to this endpoint:</p>

<pre class="lang-js prettyprint-override"><code>router.get("/", async (req, res) =&gt; {
  try {
    const data = await DataSchema.find({}).lean();
    res.json(data);
  } catch (err) {
    res.status(404);
  }
});

</code></pre>

<p>As you can see, I already use <strong>lean()</strong>, because I'm fine with a simple json.<br>
However, when I do the query on the client side:<br>
<a href="https://i.stack.imgur.com/ygrXH.png" rel="nofollow noreferrer">DevTools(F12) - Network</a><br>
<a href="https://i.stack.imgur.com/MVQVe.png" rel="nofollow noreferrer">xhr request details</a><br>
at this point I had around 270 documents in my database.</p>

<p>I don't think it could be a network issue, because when I limit the query to the first 10 elements, its much faster but still takes a second or so, which is very slow in my opinion.</p>

<p><strong>Is there any way to make this faster?</strong></p>

<p>Additionaly you may be interested: For development I am using the free tier of MongoDB Atlas (so no profiler and/or performance analytics), and I'm not yet at production so I have no production environment to test there. Also, the region is Belgium (europe-west1), this is the closest to me, but that shouldn't really make this much difference.</p>

<p>Also, I tried removing <strong>text_transform</strong> as I don't neccessarily need it right now. Not much difference.</p>

<p><strong>EDIT:</strong></p>

<p>I forgot to say, I implemented an endpoint that returns a hardcoded json. That is done in less than 1 ms. So that's why I think the query is slow here.</p>

<p><strong>.explain() results</strong></p>

<pre><code>[
  {
    queryPlanner: {
      plannerVersion: 1,
      namespace: 'test.articles',
      indexFilterSet: false,
      parsedQuery: {},
      winningPlan: [Object],
      rejectedPlans: []
    },
    executionStats: {
      executionSuccess: true,
      nReturned: 301,
      executionTimeMillis: 0,
      totalKeysExamined: 0,
      totalDocsExamined: 301,
      executionStages: [Object],
